import React from 'react';
import '../styles/Series.css';

export default function BCSCard(props) {
    var keys = [];
    for (var i in props.CPS) {
        keys.push(i)
    }
    console.log(keys);

    var switcher = 0;
    function handleClick() {
        if (switcher === 1) {
            switcher = 0;
            $()
        }
        switcher = 1;

    }
    return (
        <div id="info">
            <div id="temporada">
                <h2> Temporada { props.value } </h2>
            </div>
            <div id="capitulos">
                {keys.map((value, id) => {
                    return (<h4> Episodio {value}: { props.CPS[value]['title'] } </h4>)
                })}
            </div>
        </div>
    );
}
